window.bookSummaryJSON = "<p><b>She's a city slicker from Los Angeles. I'm a cowboy from Texas. She definitely wants me; she just doesn't know it yet.</b></p> <p>She walked straight out of my dreams and into this tiny town. I swept her off her feet on the dance floor. She gave me the best kiss I've ever had.</p> <p>It was all going so well â€¦ until it wasn't. Like a real-life Cinderella, she ran off without giving me her number.</p> <p>Dumbfounded, I assumed I'd never see her again. Until she walked right into our barn the next morning.</p> <p>Turns out, she's the wedding planner for my brother's upcoming nuptials. And I'm the best man. Which means we'll be seeing a whole lot more of each other.</p> <p>Surely, I can win over her heart. Ladies love country boys, right?</p> <p>Accidentally My Cowboy <i>is a sweet, small-town, opposites attract romantic comedy with plenty of sizzle while keeping the bedroom door closed. It's the second standalone love story in the Brothers of Lucky Seven Ranch Series.</i></p>"; 
